import { Input, Col, Row } from 'antd';
import './styleJobOpening.css';

function jobOpening(props) {
  const { Search } = Input;
  return (
    <div className="jopOpenings-body">
      <div className="jopOpenings-header">
        <h3>Job openings</h3>
      </div>

      <Row gutter={[0, 16]}>
        <Col
          xs={{ span: 20, offset: 1 }}
          sm={{ span: 22, offset: 2 }}
          md={{ span: 20, offset: 3 }}
          lg={{ span: 18, offset: 3 }}
        >
          <div className="jopOpenings-title">
            <p>
              <span className="jopOpening-welcome">Welcome!</span> <br /> We
              want people to thrive. We believe you do your best work when you
              feel your best.
            </p>
          </div>

          <Search
            placeholder="input search text"
            onSearch={props.onSearch}
            bordered={false}
            style={{
              width: `70%`,
              boxShadow: `0px 3px 30px #00000029`,
              paddingTop: '8px',
              paddingBottom: '7px',
              background: `white`,
              borderRadius: '15px',
              marginBottom: `43px`,
            }}
            className="job-search jobOpenings"
          />
        </Col>

        <Col
          xs={{ span: 20, offset: 1 }}
          sm={{ span: 22, offset: 2 }}
          md={{ span: 20, offset: 3 }}
          lg={{ span: 12, offset: 6 }}
        >
          <div className="jobOpenings-result">
            <p>
              <bold className="openingJob">Senior UI/UX Developer</bold> ,Nablus- Rafidia branch Today
            </p>
          </div>
        </Col>
        <Col
          xs={{ span: 20, offset: 1 }}
          sm={{ span: 22, offset: 2 }}
          md={{ span: 20, offset: 3 }}
          lg={{ span: 12, offset: 6 }}
        >
          <div className="jobOpenings-result">test1</div>
        </Col>
      </Row>
    </div>
  );
}

export default jobOpening;
